data.query:
query GetProductMarketSales($productId: String!, $currencyCode: CurrencyCode, $market: String, $first: Int, $isVariant: Boolean!) {
  product(id: $productId) @skip(if: $isVariant) {
    id
    market(currencyCode: $currencyCode) {
      ...MarketSalesFragment
    }
  }
  variant(id: $productId) @include(if: $isVariant) {
    id
    market(currencyCode: $currencyCode) {
      ...MarketSalesFragment
    }
  }
}

fragment MarketSalesFragment on Market {
  sales(first: $first, market: $market) {
    edges {
      cursor
      node {
        amount
        associatedVariant {
          id
          traits {
            size
          }
        }
        sameFees
        createdAt
        orderType
      }
    }
  }
}
